INSERT INTO `bottega` (`ID_bottega`, `email`, `nome`, `indirizzo`, `città`, `descrizione`, `num_like`, `lunedì`, `martedì`, `mercoledì`, `giovedì`, `venerdì`, `sabato`, `domenica`) VALUES
(2, 'naccilavoro@email.com', 'Il Capolavoro di Nacci', 'via carducci 2', 'Santa croce', 'La bottega, con la sua facciata accogliente e decorata, invita i visitatori a scoprire un mondo di colori e forme. All\'interno, scaffali pieni di vasi, piatti e sculture mostrano l\'incredibile talento di Giovanni. Ogni pezzo è lavorato e dipinto a mano, utilizzando tecniche tramandate da generazioni.\r\n', 65, '09-13 15-18', '09-13 15-18', '09-13 15-18', '09-13 15-18', '09-13 15-18', '09-13 15-18', 'chiuso'),
(3, 'Giuliart@email.com', 'La Tintoria Creativa', 'via pozzi  33', 'San miniato', 'Nel suggestivo borgo di San Miniato, tra le colline toscane, si trova la Bottega d\'Arte \"La Tintoria Creativa\". Fondata da Giulia Bianchi, una talentuosa artista locale, questa bottega è un\'oasi di creatività dove l\'arte tessile prende vita.', 74, '9-12.30 15-18', '9-12.30 15-18', '9-12.30 15-18', '9-12.30 15-18', '9-12.30 15-18', '8.30-11 16-18.30', 'chiuso'),
(4, 'CarloWhite@email.com', 'Il Maestro Intagliatore', 'via ruggero 12', 'Santa Croce', 'Nel cuore di Santa Croce, tra le vie strette e acciottolate, si erge la Bottega del Legno \"Il Maestro Intagliatore\". Guidata da Carlo Rossi, un abile artigiano con una passione per il legno che si tramanda da generazioni, questa bottega è un tempio dell\'arte intagliatrice.\r\nCarlo, con le sue mani sapienti, crea pezzi unici che combinano maestria tecnica e creatività artistica. Dalle sculture sacre agli arredi su misura, ogni oggetto è realizzato con cura e precisione, riflettendo l\'amore e la dedizione che l\'artigiano mette nel suo lavoro.', 84, '8-11.30 15-19', '8-11.30 15-19', '8-11.30 16.30-20', '8-11.30 15-19', '8-11.30 15-19', 'chiuso', 'chiuso'),
(6, 'stellitanoPasquale@email.com', 'Stellitano Pelli di Stellitano Pasquale', 'Via di Ripa 53', 'Santa Croce', 'La nostra attività è specializzata nella lavorazione di pellame di vario genere. La nostra squadra si occupa di soddisfare al meglio le richieste dei nostri clienti. Il nostro punto di forza è la qualità dei nostri prodotti, che offriamo senza quantitativi minimi. Lavoriamo per passione.', 60, '08-13 14-19', '08-13 14-19', '08-13 14-19', '08-13 14-19', '08-13 14-19', '09-13', 'chiuso'),
(7, 'info@falegnamiartigiani.it', 'Falegnami Artigiani Riuniti', 'Via Filippo Corridoni 28', 'San Miniato', 'La FALEGNAMI ARTIGIANI RIUNITI SRL nasce nel 1976.\r\n\r\nOggi, grazie alla grande esperienza acquisita nel settore, è in grado di offrire svariate soluzioni nella progettazione e produzione artigianale di arredamento su misura in ogni stile, con materiali di altissima qualità e svariate finiture per rendere la Vostra casa unica ed accogliente.\r\n\r\nLa soddisfazione del cliente, la serietà e la professionalità della FALEGNAMI ARTIGIANI RIUNITI SRL, sono per questa azienda la migliore fonte di pubblicità e, certa di soddisfare anche le esigenze della clientela più esigente, Vi aspetta per un preventivo gratuito.', 41, '08-12 14-19', '08-12 14-19', '08-12 14-19', '08-12 14-19', '08-12 14-19', 'chiuso', 'chiuso'),
(8, 'LaTipografaToscana@email.com', 'La Tipografa Toscana', 'Via G. Deledda 8', 'San Miniato', 'Coltivare e diffondere la cultura della tipografia artigianale nel 21mo secolo non significa solo preservare la tecnica di stampa nata con Gutenberg intorno alla metà del 1400. Significa anche sperimentare nuove forme di comunicazione, dove le parole vivono in equilibrio perfetto tra passato, presente e futuro. Le opere che nascono sono stampate manualmente con il tirabozze, pedalina, torchio… macchine completamente meccaniche che non utilizzano energia elettrica, ma forza manuale e magia.', 81, '08-13 14-19', '08-13 14-19', '08-13 14-19', '08-13 14-19', '08-13 14-19', '09-13', 'chiuso');

